import React from 'react';
import Card from './Card';
import Data from './Data';

function App(){
    return (
        <>
        <h1>React Component</h1>
            <Card
                chabi={Data[0].chabi}
                nam={Data[0].nam}
                link={Data[0].link}
             />
            <Card
                chabi={Data[1].chabi}
                nam={Data[1].nam}
                link={Data[1].link}
             />
            <Card
                chabi={Data[2].chabi}
                nam={Data[2].nam}
                link={Data[2].link}
             />
            
        </>
    );
}
export default App;
